import React from 'react';

function Catigories({items}) {

  console.log(items)

  return (
    <div className="categories">
      <ul>
        <li className="active">Все</li>
        {items.map((item) => {
          <li>{item}</li>
        })}
      </ul>
    </div>
  );
}

export default Catigories;
